import React from 'react';
import PropTypes from 'prop-types';
import {Panel, ListItem, Button, Group, Div, Avatar, PanelHeader,HeaderButton, platform,IOS } from '@vkontakte/vkui';
import persik from '../img/persik.jpg';
import u1 from '../img/61.png';
import u2 from '../img/62.png';
import u3 from '../img/63.png';
import u4 from '../img/64.png';
import u5 from '../img/65.png';
import u6 from '../img/66.png';
import u7 from '../img/67.png';
import u8 from '../img/68.png';
import u9 from '../img/69.png';
import u10 from '../img/70.png';
import u11 from '../img/71.png';
import u12 from '../img/72.png';
import u13 from '../img/73.png';
import u14 from '../img/74.png';
import u15 from '../img/75.png';
import u16 from '../img/76.png';
import u17 from '../img/77.png';
import u18 from '../img/78.png';
import u19 from '../img/79.png';
import u20 from '../img/80.png';
import u21 from '../img/81.png';
import u22 from '../img/82.png';
import u23 from '../img/83.png';
import u24 from '../img/84.png';
import u25 from '../img/85.png';
import u26 from '../img/86.png';
import u27 from '../img/87.png';
import u28 from '../img/88.png';
import u29 from '../img/89.png';
import u30 from '../img/90.png';
import u31 from '../img/91.png';
import u32 from '../img/92.png';
import u33 from '../img/93.png';
import u34 from '../img/94.png';
import u35 from '../img/95.png';

import './Persik.css';
import Icon28ChevronBack from '@vkontakte/icons/dist/28/chevron_back';
import Icon24Back from '@vkontakte/icons/dist/24/back';

const osname = platform();

const Persik = props => (
	<Panel id={props.id}>
		<PanelHeader
			left={<HeaderButton onClick={props.go} data-to="home">
				{osname === IOS ? <Icon28ChevronBack/> : <Icon24Back/>}
			</HeaderButton>}
		>
			Тригонометрия
		</PanelHeader>
		<Div className ='cent'>
		<Div className ='st'>

		<Div className='div_img_big'><img className="Persik" src={u1} alt="Persik The Cat"/></Div>
		
		</Div>
        </Div>

        <Div className ='cent'>
		<Div className ='st'>

		<Div className='droby'><img className="Persik" src={u2} alt="Persik The Cat"/></Div>
		<Div className='droby'><img className="Persik" src={u3} alt="Persik The Cat"/></Div>
		<Div className='droby'><img className="Persik" src={u4} alt="Persik The Cat"/></Div>
		<Div className='droby'><img className="Persik" src={u5} alt="Persik The Cat"/></Div>
		
		</Div>
        </Div>

        <Div className ='cent'>
		<Div className ='st'>

		<Div className='droby'><img className="Persik" src={u6} alt="Persik The Cat"/></Div>
		<Div className='droby'><img className="Persik" src={u7} alt="Persik The Cat"/></Div>
		<Div className='droby'><img className="Persik" src={u8} alt="Persik The Cat"/></Div>
		
		
		</Div>
        </Div>

        <Div className ='cent'>
		<Div className ='st'>

		<Div className='droby'><img className="Persik" src={u9} alt="Persik The Cat"/></Div>
		<Div className='droby'><img className="Persik" src={u10} alt="Persik The Cat"/></Div>
		<Div className='droby'><img className="Persik" src={u11} alt="Persik The Cat"/></Div>
		<Div className='droby'><img className="Persik" src={u12} alt="Persik The Cat"/></Div>
		
		</Div>
        </Div>

        <Div className ='cent'>
		<Div className ='st'>

		<Div className='droby'><img className="Persik" src={u13} alt="Persik The Cat"/></Div>
		<Div className='droby'><img className="Persik" src={u14} alt="Persik The Cat"/></Div>
		<Div className='droby'><img className="Persik" src={u15} alt="Persik The Cat"/></Div>
		<Div className='droby'><img className="Persik" src={u16} alt="Persik The Cat"/></Div>
		<Div className='droby'><img className="Persik" src={u17} alt="Persik The Cat"/></Div>
		<Div className='droby'><img className="Persik" src={u18} alt="Persik The Cat"/></Div>
		<Div className='droby'><img className="Persik" src={u19} alt="Persik The Cat"/></Div>
		<Div className='droby'><img className="Persik" src={u20} alt="Persik The Cat"/></Div>
		
		</Div>
        </Div>

		<Group>
			<Div>
				<Button size="xl" level="2" onClick={props.go} data-to="home">
					Назад
				</Button>
			</Div>
		</Group>

	</Panel>
);

Persik.propTypes = {
	id: PropTypes.string.isRequired,
	go: PropTypes.func.isRequired,
};

export default Persik;
